import { Resend } from "resend";

const resend = new Resend(process.env.RESEND_API_KEY);

// Paste your base64 logo here (from the script output)
const LOGO_BASE64 = "data:image/png;base64,"; // Replace with your actual base64

export default async function handler(req, res) {
  if (req.method !== "POST") {
    return res.status(405).json({ error: "Method not allowed" });
  }

  const { name, email } = req.body;

  if (!name || !email) {
    return res.status(400).json({ error: "Missing name or email" });
  }

  try {
    await resend.emails.send({
      from: "Talon Cleaning Services <customersupport@mail.taloncleaningservices.co.uk>",
      to: email,
      replyTo: "customersupport@taloncleaningservices.co.uk",
      subject: "Thank You for Your Request!",
      html: `
<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <style>
    body {
      margin: 0;
      padding: 0;
      font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Helvetica, Arial, sans-serif;
      background-color: #f4f4f4;
    }
    .email-container {
      max-width: 600px;
      margin: 40px auto;
      background-color: #ffffff;
      border-radius: 8px;
      overflow: hidden;
      box-shadow: 0 2px 8px rgba(0, 0, 0, 0.1);
    }
    .email-header {
      background: linear-gradient(135deg, #0F2A44 0%, #1a3a5c 100%);
      padding: 40px 30px;
      text-align: center;
    }
    .logo {
      max-width: 80px;
      height: auto;
      margin-bottom: 15px;
    }
    .company-name {
      color: #ffffff;
      font-size: 24px;
      font-weight: bold;
      margin: 0;
      letter-spacing: 0.5px;
    }
    .company-tagline {
      color: #C6A35A;
      font-size: 14px;
      margin: 8px 0 0 0;
      font-weight: 500;
    }
    .email-body {
      padding: 40px 30px;
      color: #2E2E2E;
      line-height: 1.6;
    }
    .greeting {
      font-size: 18px;
      font-weight: 600;
      color: #0F2A44;
      margin-bottom: 20px;
    }
    .content p {
      margin: 16px 0;
      font-size: 15px;
    }
    .highlight-box {
      background-color: #F7F6F2;
      border-left: 4px solid #C6A35A;
      padding: 20px;
      margin: 24px 0;
      border-radius: 4px;
    }
    .highlight-box h3 {
      margin: 0 0 12px 0;
      color: #0F2A44;
      font-size: 16px;
      font-weight: 600;
    }
    .highlight-box ul {
      margin: 8px 0;
      padding-left: 20px;
    }
    .highlight-box li {
      margin: 8px 0;
      color: #2E2E2E;
    }
    .signature {
      margin-top: 30px;
      padding-top: 20px;
      border-top: 1px solid #e0e0e0;
    }
    .signature-name {
      font-weight: 600;
      color: #0F2A44;
      margin-bottom: 4px;
    }
    .signature-title {
      color: #666;
      font-size: 14px;
    }
    .email-footer {
      background-color: #0F2A44;
      color: #ffffff;
      padding: 25px 30px;
      text-align: center;
      font-size: 13px;
    }
    .footer-divider {
      width: 60px;
      height: 2px;
      background-color: #C6A35A;
      margin: 0 auto 15px auto;
    }
    .contact-info {
      margin: 15px 0;
      line-height: 1.8;
    }
    .contact-info a {
      color: #C6A35A;
      text-decoration: none;
    }
  </style>
</head>
<body>
  <div class="email-container">
    <!-- Header with Logo -->
<table width="100%" cellpadding="0" cellspacing="0" border="0" class="email-header" style="text-align:center;">
  <tr>
    <td align="center">
      <table cellpadding="0" cellspacing="0" border="0">
        <tr>
          <!-- Logo -->
          <td style="vertical-align: middle; padding-right: 10px;">
            <img 
              src="${LOGO_BASE64}" 
              alt="Talon Cleaning Services" 
              width="60" 
              style="display:block; height:auto;"
            />
          </td>

          <!-- Company Name -->
          <td style="vertical-align: middle;">
            <h1 style="margin:0; font-size:20px; font-weight:bold;">
              TALON CLEANING SERVICES
            </h1>
          </td>
        </tr>
      </table>
    </td>
  </tr>
</table>

    <!-- Email Body -->
    <div class="email-body">
      <div class="greeting">Hello ${name},</div>
      
      <div class="content">
        <p>Thank you for choosing <strong>Talon Cleaning Services</strong>.</p>
        
        <p>We're pleased to support you with your cleaning requirements and look forward to delivering a reliable, high-quality service that exceeds your expectations.</p>

        <div class="highlight-box">
          <h3> What Happens Next:</h3>
          <ul>
            <li>A member of our team will contact you within <strong>24 hours</strong> to discuss your specific needs</li>
            <li>We'll arrange a convenient time to review your requirements in detail</li>
            <li>You'll receive a personalized quote tailored to your space</li>
          </ul>
        </div>

        <p>If you have any questions, special requests, or would like to discuss anything in the meantime, please don't hesitate to reply to this email or call us directly.</p>

        <div class="signature">
          <div class="signature-name">Warm regards,</div>
          <div class="signature-title">The Talon Cleaning Services Team</div>
        </div>
      </div>
    </div>

    <!-- Footer -->
    <div class="email-footer">
      <div class="footer-divider"></div>
      <div class="contact-info">
        <strong>Get in Touch</strong><br/>
         <a href="tel:+441234567890">+44 (0) 1234 567890</a><br/>
         <a href="mailto:customersupport@taloncleaningservices.co.uk">customersupport@taloncleaningservices.co.uk</a><br/>
         <a href="https://taloncleaningservices.co.uk">www.taloncleaningservices.co.uk</a>
      </div>
      <div style="margin-top: 20px; padding-top: 15px; border-top: 1px solid rgba(255,255,255,0.1); font-size: 12px; color: rgba(255,255,255,0.7);">
         ${new Date().getFullYear()} Talon Cleaning Services. All rights reserved.
      </div>
    </div>
  </div>
</body>
</html>
`,
    });

    return res.status(200).json({ message: "Auto-reply sent" });
  } catch (err) {
    console.error(err);
    return res.status(500).json({ error: "Failed to send email" });
  }
}